import{_ as t,c as r,o as e,a3 as o}from"./chunks/framework.C5dE-MyI.js";const b=JSON.parse('{"title":"FEDay","description":"","frontmatter":{"title":"FEDay","customTag":"blog>线下活动","editLink":true,"date":"2023.11.18"},"headers":[],"relativePath":"blog/fe-day.md","filePath":"blog/fe-day.md","lastUpdated":1725235004000}'),a={name:"blog/fe-day.md"},n=o('<h1 id="feday" tabindex="-1">FeDay <a class="header-anchor" href="#feday" aria-label="Permalink to &quot;FeDay&quot;">​</a></h1><p><a href="https://fequan.com/2023/" target="_blank" rel="noreferrer">https://fequan.com/2023/</a></p><p>周六去了前端圈主办的前端活动，FEDay。</p><p>活动信息如下：</p><ul><li>活动：FEDay</li><li>地点：杭州</li><li>时间：2023.11.18</li></ul><p><strong>总体来说，有以下几点感受吧。</strong></p><ul><li><strong>不同视角的信息输入</strong>：本次有很多嘉宾，基于他们个人的经历和思考，分享了多个话题，其中涵盖<strong>宏观的思考</strong>，<strong>具体技术细节落地</strong>，<strong>AI 结合前端，<strong>同时也有不同角色下的嘉宾分享他们的看法</strong>。</strong></li><li><strong>内容分享的思考</strong>：从接收者和分享者进行思考 <ul><li><strong>接受者</strong>：作为内容的接受者，我们应该把握住关注、有用的信息。</li><li><strong>分享者</strong>：作为内容的分享者，我们应该用比较注重我们核心内容的表单，减少一些无关精要的内容输入，不要过于发散。</li></ul></li><li><strong>预期之外惊喜</strong>： <ul><li><strong>遇到了新朋友</strong>：在杭州结识了一个新朋友，一起进行技术的讨论以及吃了饭，感觉挺聊得来的。只可惜没能在杭州待久一点。</li><li><strong>新观点的输入</strong>：黄玄的分享，是让我最有体感的。没有过干的技术，反倒是抽身出来，去从宏观层面进行哲学的输出。自己也会有思考，<strong>”技术发展会改变生产力和生产关系的内容，并且应该是朝着降低成本的方向前进，我们应该如何应对呢“</strong></li><li>**抽离工作之外：**有的时候，抽离工作之外，代码之外，去外面随意走走，也许也挺不错的呢。</li></ul></li></ul><h2 id="分享内容" tabindex="-1">分享内容 <a class="header-anchor" href="#分享内容" aria-label="Permalink to &quot;分享内容&quot;">​</a></h2><h3 id="网页调试的最新进展-modern-web-debugging" tabindex="-1">网页调试的最新进展（Modern Web Debugging） <a class="header-anchor" href="#网页调试的最新进展-modern-web-debugging" aria-label="Permalink to &quot;网页调试的最新进展（Modern Web Debugging）&quot;">​</a></h3><p><strong>分享嘉宾</strong>：Jecelyn Yeen (阮贝琪)</p><p><strong>总结</strong>：devtools 的一些历史，以及使用小技巧。</p><ul><li>Mock 数据</li><li>Override http</li><li>JS 片段</li><li>Sourcemap 调试</li><li>录制功能。</li></ul><p><strong>文档</strong>：<a href="https://docs.google.com/forms/d/e/1FAIpQLSc3bem7PkVG28x-JiyZePKkyxD06qiq2PkY-1dojqtCn3SMGQ/viewform" target="_blank" rel="noreferrer">https://docs.google.com/forms/d/e/1FAIpQLSc3bem7PkVG28x-JiyZePKkyxD06qiq2PkY-1dojqtCn3SMGQ/viewform</a></p><h3 id="从-js-到-ts-无缝迁移的实践报告" tabindex="-1">从 JS 到 TS 无缝迁移的实践报告 <a class="header-anchor" href="#从-js-到-ts-无缝迁移的实践报告" aria-label="Permalink to &quot;从 JS 到 TS 无缝迁移的实践报告&quot;">​</a></h3><p><strong>分享嘉宾</strong>：周爱民（Aimingoo）</p><p><strong>总结</strong>： js -&gt; ts 实践。</p><p><strong>思考</strong>：代码的健壮性以及人力成本的衡量。</p><h3 id="一种-vue-2-3-共存开发的思路" tabindex="-1">一种 Vue 2/3 共存开发的思路 <a class="header-anchor" href="#一种-vue-2-3-共存开发的思路" aria-label="Permalink to &quot;一种 Vue 2/3 共存开发的思路&quot;">​</a></h3><p><strong>分享嘉宾</strong>：蒋豪群（Soda）</p><p><strong>总结</strong>：vue2 -&gt; vue3 迁移方案。</p><h3 id="resvg-js-高性能的-svg-跨端渲染引擎" tabindex="-1">resvg-js 高性能的 SVG 跨端渲染引擎 <a class="header-anchor" href="#resvg-js-高性能的-svg-跨端渲染引擎" aria-label="Permalink to &quot;resvg-js 高性能的 SVG 跨端渲染引擎&quot;">​</a></h3><p><strong>分享嘉宾</strong>：李杰（一丝）</p><p><strong>总结</strong>：Rust + SVG 高性能。</p><h3 id="ai-大模型时代前端新思路" tabindex="-1">AI 大模型时代前端新思路 <a class="header-anchor" href="#ai-大模型时代前端新思路" aria-label="Permalink to &quot;AI 大模型时代前端新思路&quot;">​</a></h3><p><strong>分享嘉宾</strong>：吴亮（月影）</p><p><strong>总结</strong>：AI + 前端</p><ul><li>动态的 prompt</li><li>人机交互形式</li><li>自然语言接口编程</li></ul><h3 id="webnn-web-端侧推理的未来" tabindex="-1">WebNN, Web 端侧推理的未来 <a class="header-anchor" href="#webnn-web-端侧推理的未来" aria-label="Permalink to &quot;WebNN, Web 端侧推理的未来&quot;">​</a></h3><p><strong>分享嘉宾</strong>：张敏</p><p><strong>总结</strong>：</p><ul><li>webnn.dev</li><li>段侧推理。</li></ul><h3 id="如何更丝滑地在应用中调用-gpt" tabindex="-1">如何更丝滑地在应用中调用 GPT <a class="header-anchor" href="#如何更丝滑地在应用中调用-gpt" aria-label="Permalink to &quot;如何更丝滑地在应用中调用 GPT&quot;">​</a></h3><p><strong>分享嘉宾</strong>：贺师俊（Hax）</p><p><strong>课件</strong>：<a href="https://johnhax.net/2023/lets-gpt/slide" target="_blank" rel="noreferrer">https://johnhax.net/2023/lets-gpt/slide</a></p><p><strong>总结</strong>：开发者如何调用 GPT</p><ul><li>更丝滑地访问</li><li>更丝滑地用流</li><li>更丝滑地提供 Tools</li><li>更丝滑地写 Agent</li></ul><h3 id="transformers-js-state-of-the-art-machine-learning-for-the-web" tabindex="-1"><strong>Transformers.js: State-of-the-art Machine Learning for the Web</strong> <a class="header-anchor" href="#transformers-js-state-of-the-art-machine-learning-for-the-web" aria-label="Permalink to &quot;**Transformers.js: State-of-the-art Machine Learning for the Web**&quot;">​</a></h3><p><strong>分享嘉宾：Joshua Lochner（远程分享）</strong></p><p><strong>总结</strong>：通过 Transformers.js 将模型带到 Web 中，使得在 Web 端有机器学习能力。</p><h3 id="抖音商家端-rust-业务实践" tabindex="-1"><strong>抖音商家端 Rust 业务实践</strong> <a class="header-anchor" href="#抖音商家端-rust-业务实践" aria-label="Permalink to &quot;**抖音商家端 Rust 业务实践**&quot;">​</a></h3><p><strong>分享嘉宾：陈天壹（七桑）</strong></p><p><strong>总结</strong>：rust 在前端的落地实践。</p><h3 id="我的大前端世界观" tabindex="-1"><strong>我的大前端世界观</strong> <a class="header-anchor" href="#我的大前端世界观" aria-label="Permalink to &quot;**我的大前端世界观**&quot;">​</a></h3><p><strong>分享嘉宾：黄玄（Hux）</strong></p><p><strong>总结：</strong></p><ul><li>如何定义前端。</li><li>历史拐点和成本理论。</li><li>再定义前端。</li></ul><p><strong>思考</strong>：”技术发展会改变生产力和生产关系的内容，并且应该是朝着降低成本的方向前进，我们应该如何应对呢“</p><p>总体听下来，一些思考吧</p><ul><li>深度接触 AI 吧：未来应该会要求需要使用 AI 工具的能力，如今天我们大多人需要学习上网一样。</li><li>可以多接触技术之外的事，经济学，传播学，商业。</li><li>刻意练习。</li></ul>',49),s=[n];function l(i,g,h,p,d,u){return e(),r("div",null,s)}const f=t(a,[["render",l]]);export{b as __pageData,f as default};
